import frame11Img1 from '../assets/img/frame11/frame11Img1.png'
import frame11Img2 from '../assets/img/frame11/frame11img2.png'
import frame11Img3 from '../assets/img/frame11/frame11img3.png'
import frame11Icon from '../assets/img/frame11/Vector.png'
const frame11 = [
    {
        frame11Title: [
            {
                id: 0,
                text: 'по версии отдыхающих'
            },
            {
                id: 1,
                text: 'Популярные направления'
            }
        ],
        frame11Img: [
            {
                id: 0,
                img: frame11Img1,
                icon: ''
            },
            {
                id: 1,
                img: frame11Img2
            },
            {
                id: 2,
                img: frame11Img3
            },

        ]
    }
]
export default frame11
